import React from 'react'
import { BrowserRouter, Route, Routes } from 'react-router-dom'
import Home from '../pages/Home'

export function Nav() {
  return (
    <BrowserRouter>
        <Routes>
            <Route path='/' exac element={<Home/>}/>
        </Routes>
    </BrowserRouter>
  )
}
